import './App.css'

function CreateList() {
    return (
        <>
            <h1>Stephanie's To-Do List</h1>
            <ul>
                <li><input type="checkbox"/>Work out</li>
                <li><input type="checkbox"/>Do school work and assignments</li>
                <li><input type="checkbox"/>Pick up kids</li>
                <li><input type="checkbox"/>Cook dinner</li>
            </ul>
        </>
    );
}

export default CreateList;
